import React from 'react';
import Online, { Offline } from './OnlineOfflineMethodData';

const JEFeatureCardBody = () => {
    return (<>
        <div className="card-body">
            <div className="tab-content">
                <div className="tab-pane fade show active" id="online">
                    <div className="row my-5">
                        {NewOnline}
                    </div>
                </div>
                <div className="tab-pane fade" id="offline">
                    <div className="row my-5">
                        {NewOffline}
                    </div>
                </div>
            </div>
        </div>
    </>)
}

export default JEFeatureCardBody;
